		iFov = ( ( pow( Settings::Triggerbot::weapon_trigger_settings[iWeaponID].trigger_AssistFov + FIX_MIN_FOV_CHEST , 2 ) * 90 ) / ( pPlayer->iDistance * m_pLocal->iFov ) );
