			{
				if ( !CheckPlayerTriggerPos() && !pPlayer->bTriggerFov )
				{
					iTriggerShotsFired = 0;
					m_pTriggerDelayBefore->reset();
					m_pTriggerDelayAfter->reset();
				}
			}

